import React, {useEffect, useState} from 'react'
import axios from 'axios'

function App() {

  const [user, setUser] = useState();

  useEffect(() => {
    axios.get('/api')
    .then((result) => {
      setUser(result.data[0]);
      console.log(result.data);
    })
    .catch((error) => {
      console.log(error);
    })
  }, [])



  return (
    <div>
      <button>버튼</button>
      <h1>리스트</h1>
    </div>
  )
}

export default App
